import React from "react";
import '../scss/main.scss';

const Contact = () => {

    return (
        <section className='contact'>
            <div className='wrapper'>
                <div className='contact__container'>
                    <div className='contact__open'>
                        <h1>Otwarte:</h1>
                    </div>
                </div>
            </div>
        </section>
    )
}
export default Contact;
